                    //     // setSummerHigh()
                    //     // setFallHigh()
                    // }


                    currentCityClimateTD.push(key)
                    currentCityClimateTR.push(value)
                }
            }
            else{
                console.log('failure')
            }
            }
    }

    const getKoppenClimate = async () => {
        //grab lat and lon
            let city = currentCity
            let state = ''
            let country = currentState

            if (currentCity == ''){
                return
            }
            if (statesUSA.includes(currentState)){
                state = currentState
                country = 'us'
            }

            console.log(currentCity, currentState)

            const baseURL1 = `https://api.openweathermap.org/geo/1.0/direct?q=${city},${state},${country}&limit=2&appid=3dd6b4b0643fe807a69521e6f5cd399a`

            await axios.get(baseURL1).then((response)=> {
                console.log(response)
                const lat =  response.data[0].lat
                const lon = response.data[0].lon
                const first_res = response
                console.log('lat: ', lat,'lon: ', lon)


            // get koppen climate type
            const baseURL2 = `http://climateapi.scottpinkelman.com/api/v1/location/${lat}/${lat}`
            axios.get(baseURL2).then((response)=> {
                const koppen = response.data.return_values[0].zone_description
                // const koppen = 
                // console.log('lat: ', lat,'lon: ', lon)
                setkoppenClimate(koppen)
                console.log(koppen)
                });

            })
    }

      // Start the fetch operation as soon as
    // the page loads
    useEffect(() => {
        FetchClimates();
        DisplayData();
        getKoppenClimate();
    }, [currentCity, currentCityClimateTD, currentCityClimateTR, currentState, koppenClimate])

    // console.log("currentCityClimate",currentCityClimateTD)
    return (
    <>
        <section id='about'>
        <h3>About</h3>
        <p>Random Latin filler words...</p>
    </section>

    <section id='get-started'>
        <h3>Get Started!</h3>
        <p>Random Latin filler words....</p>

        <div className="column" id="left-column">   
            <div id ='map'>****Map Goes Here****</div>
        </div>

        <p>Select a city and country and get started!</p>

        <select
        onChange={((event) => setcurrentCity(event.target.value))}
        >
        <option>City</option>
        {climate.map((obj) =>(
            <option
                className="item"
                key = {obj.id}
                >
                    {obj.city}
            </option>
        ))}
        </select>
        <br/>
        <br/>


        <div>See Climate Data Here:
            <p>City: {currentCity + ',  '+ currentState} </p> 
            <p>Climate Type: {koppenClimate}</p> 
        </div>

        <br/>
