                <thead>
                    <tr>
                    {/* {currentCityClimateTD.map((obj) =>(
                        <td className="td-item">
                            {obj}
                        </td>
                    ))} */}
                    </tr>
                </thead>
                <tbody>
                    <tr>
                    {/* {(currentCityClimateTR) =>{ 
                        for(const [somekey, somevalue] of Object.entries(currentCityClimateTR)) {
                        () => ( 
                        <td className="td-item">
                            {somekey}
                        </td>
                        )
                    }}} */}
